    function existCardBase(uint256 _baseId) __onlyShared public view returns(bool) {
        if( _baseId > 0 && _baseId <= CardBases.getLength()) {
            return true;
        }
        return false;                
    }

    // usuable id between 1 to (n-1)
    function getMetadataFromBaseId(uint256 _baseId) __onlyShared public view returns(uint256) {
        if(existCardBase(_baseId)) {
            return CardBases.get(_baseId);
        }
        return 0;
    }

    //usuable card id starts with 1.
    function _createCardBase(uint256 _metadata) internal{
        uint256 rarity = _metadata.bGetRarity();
